  })
  return (
    <div>

      <p> Name: {Info.Name}</p>
      <p>Lastname:{Info.Lastname}</p>



      <button onClick={()=>{
       if(Info.Name==='Manpreet Kaur') 
       {setInfo({
          Name:'Aaayushmaan verma',
          Lastname:'Verma'

        })}
        else{
          setInfo({
            Name:'Manpreet Kaur',

          })
        }

      }}>Click Me</button>
    </div>
  );
}
